import React from "react";
import Logo from "../../assets/Logo.png";

function Header() {
  return (
    <div
      style={{
        backgroundColor: "red",
        display: "flex",
        justifyContent: "center",
      }}
    >
      <img src={Logo} width="10%" height="10%" />
    </div>
  );
}

export default Header;
